import React from 'react';
import { Waypoint } from 'react-waypoint';

class GraphQLtoREST extends React.Component {
  constructor(props) {
    super(props);
    this.state = { showSVG: false };
    this.handleEnter = this.handleEnter.bind(this);
    this.handleLeave = this.handleLeave.bind(this);
  }

  handleEnter() {
    this.setState({ showSVG: true });
  }

  handleLeave() {
    this.setState({ showSVG: false });
  }

  render() {
    const { showSVG } = this.state;
    return (
      <Waypoint onEnter={this.handleEnter}>
        <div style={{ margin: 'auto', maxWidth: '1300px' }}>{showSVG ? <FullSVG /> : <ApiSVG />}</div>
      </Waypoint>
    );
  }
}

